nd for both members and casual riders\n","<a id=\"act\"></a>\n","\n","\n","# Act/Recommendations\n","In order to attract more casual riders to become members, we need to run campaign that targets them outside of working hours\n","- Discount promotions for trips over 30 minutes for both casual and member riders which encourage riders to use the bikes more\n","- Giveaway gifts such as protection equipments for first time members over weekends and weeknights\n","- Give rewards for riders who achieve different milestones and even more rewards for achieving milestones as members"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":267.672177,"end_time":"2022-11-24T15:02:29.65553","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-11-24T14:58:01.983353","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}